import React from 'react'

export default function CardItems(props) {
  return (
    <>
        <div className="card">
        <h1>{props.title}</h1>
        <img src={props.imag} alt="" className="imageCard" />
        <p className="price">{props.price}</p>
        </div>
    </>
  )
}
